"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    HRT increases pulmonary embolism",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 389px; height: 226px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the Women's Health Initiative, combined estrogen-progestin replacement therapy was associated with a significant increase in pulmonary embolism (eight more pulmonary emboli per 10,000 person-years, HR 2.13, unadjusted 95% CI 1.39-3.25).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Risks and benefits of estrogen and progestin in healthy postmenopausal women: principal results from the Women's Health Initiative randomized controlled trial. JAMA 2002; 288:321.",
